function approveNode(key, status, node) {
  console.log(key, status, node);
  var userId = firebase.auth().currentUser.uid;
  var addRef = firebase.database().ref('users/' + userId + '/' + node + '/' + key);
  var updateRef = addRef.update({
    status: status
  }, function (error, success) {
    if (error) {
      console.log(error);
    } else {
      console.log('Approved user ' + node + ' data');
      localStorage.removeItem('user' + node);
      resetNode(node);
    }
  });

  function resetNode(node) {
    setTimeout(function () {
      addRef.once("value").then(function (snapshot) {
        var key = snapshot.key;
        var fbData = snapshot.val();
        var fbDataObj = {
          fbData: fbData
        };
        var remoteData = JSON.parse(JSON.stringify(fbDataObj).split('"fbData":').join('"' + key + '":'));
        var localNode = 'user' + node;
        var localData = JSON.parse(localStorage.getItem(localNode));
        var newData = Object.assign({}, remoteData, localData);
        console.log(newData);
        console.log(localNode);
        localStorage.removeItem(localNode);
        localStorage.setItem(localNode, JSON.stringify(newData));
        refreshTableData();
      });
    }, 500);
  }
}
