function riskRateFunction(editor, node) {
  $(".risk-compare .select-wrapper ul li").on('click', function (e) {
    var schemapath = e.currentTarget.parentNode.parentNode.parentNode.parentNode.parentNode.parentNode.parentNode.parentNode.parentNode.dataset.schemapath;
    var selectedValue = e.currentTarget.lastChild.parentNode.parentNode.parentNode.lastChild.value;
    var valueNodeList = e.currentTarget.lastChild.parentNode.parentNode.parentNode.lastChild.childNodes; // console.log(schemapath);
    // console.log(selectedValue);
    // console.log(valueNodeList);

    var value = editor.getEditor(schemapath + '.Value');
    var risk = editor.getEditor(schemapath + '.Rating');

    for (var i = 0; i < valueNodeList.length; i++) {
      if (valueNodeList[i].value === selectedValue) {
        var res = valueNodeList[i].value.split("^", 2);
        selectRiskSiblingLevel(res);
      }
    }

    function selectRiskSiblingLevel(res) {
      if (value) {
        value.setValue(res[0]); // console.log(value.getValue());
      }

      if (risk) {
        risk.setValue(res[1]); // console.log(risk.getValue());
      }

      setCurrentAssessment(editor, node);
      riskRateCalculation(editor);
    }
  });
}
function riskRateCalculation(editor) {
  var currentassessment = JSON.parse(localStorage.getItem('currentassessment'));
  var f = new Flattenr(currentassessment, "/");
  var ratings = f.find("Rating").get();
  var value = Object.values(ratings);
  var highest = Math.max.apply(Math, _toConsumableArray(value));
  JSON.stringify(localStorage.setItem('currentassessmentrisk', highest)); //remove classes

  $('.risk-number').removeClass('red-text');
  $('.risk-number').removeClass('orange-text');
  $('.risk-number').removeClass('brown-text');
  $('.risk-number').removeClass('yellow-text');
  $('.risk-number').removeClass('green-text');
  console.log(highest);

  if (highest == 5) {
    $('.risk-number').text(highest).addClass('red-text');
  }

  if (highest == 4) {
    $('.risk-number').text(highest).addClass('orange-text');
  }

  if (highest == 3) {
    $('.risk-number').text(highest).addClass('brown-text');
  }

  if (highest == 2) {
    $('.risk-number').text(highest).addClass('yellow-text');
  }

  if (highest == 1) {
    $('.risk-number').text(highest).addClass('green-text');
  }
}
function fetchChemicalDetails(chemName, chemKey, tokenType) {
  var url = 'https://pubchem.ncbi.nlm.nih.gov/rest/pug/compound/name/' + chemName + '/cids/JSON';
  fetch(url).then(function (res) {
    if (res.ok) {
      return res.json();
    }

    throw new Error('Network response was not ok.');
  }).then(function (data) {
    var cid = data.IdentifierList.CID;
    var url = 'https://pubchem.ncbi.nlm.nih.gov/rest/pug_view/data/compound/' + cid + '/JSON';
    fetch(url).then(function (res) {
      if (res.ok) {
        return res.json();
      }

      throw new Error('Network response was not ok.');
    }).then(function (data) {
      // console.log(data);
      var objName = tokenType + 'Data';
      var selectedData = {
        'name': chemName,
        'key': chemKey
      };

      var chemTokendata = _objectSpread({}, data, selectedData);

      var chemRecordDataLowercase = data.Record.RecordTitle.toLowerCase();
      combineLocalStorageObj(objName, chemTokendata);
    });
  });
}
function combineLocalStorageObj(objName, newData) {
  console.log('objName: ');
  console.log(objName);
  console.log('newData: ');
  console.log(newData);
  var combined = [];
  var originObject = JSON.parse(localStorage.getItem(objName));

  if (originObject !== null) {
    var originObjectKeys = Object.values(originObject);

    for (var i = 0; i < originObjectKeys.length; i++) {
      if (originObjectKeys[i].key !== newData.key) {
        combined.push(originObjectKeys[i]);
      }
    }

    combined.push(newData);
  } else {
    combined.push(newData);
  }

  console.log('combined push: ');
  console.log(combined); // Write the new item to localStorage

  localStorage.removeItem(objName);
  localStorage.setItem(objName, JSON.stringify(combined));
}
